          <ul>
            <li>
              <Link to="/"></Link>
            </li>
            <li>
              <Link to="/blog"></Link>
            </li>
          </ul>
        </nav>
      </header>

      <Route path="/" exact component={Face} />
      <Route path="/blog" exact component={Blog} />
    </React.Fragment>
  );
};

export default layout;
